# ConfigMap for storing model (for small models)
# For larger models, use PersistentVolume or cloud storage
apiVersion: v1
kind: ConfigMap
metadata:
  name: model-config
binaryData:
  trained_model.h5: |
    

   
---
# Alternative: PersistentVolume for larger models
apiVersion: v1
kind: PersistentVolumeClaim
metadata:
  name: model-pvc
spec:
  accessModes:
    - ReadWriteOnce
  resources:
    requests:
      storage: 1Gi
  storageClassName: standard  # Adjust based on your cluster
---
# Job to load model into PVC (run once)
apiVersion: batch/v1
kind: Job
metadata:
  name: model-loader
spec:
  template:
    spec:
      containers:
      - name: model-loader
        image: busybox:1.35
        command: ["/bin/sh"]
        args:
          - -c
          - |
            echo "Decoding trained_model.h5 from base64..."
            cat <<EOF | base64 -d > /data/trained_model.h5
            
            EOF
        volumeMounts:
        - name: model-storage
          mountPath: /data
      restartPolicy: Never
      volumes:
      - name: model-storage
        persistentVolumeClaim:
          claimName: model-pvc
  backoffLimit: 3
